import React, {Component} from 'react';
import Mensaje from './Mensaje';

class Peliculas extends Component{
    render(){
        return (
            <React.Fragment>
                <h1>Holi x2</h1>
            <Mensaje />
            </React.Fragment>
        );
    }
}
export default Peliculas;
